using namespace std;

int palindromeIndex(string s) {
    
    int left = 0;
    int right = s.size()-1;
    while(left < right){
        if(left == right){
            return -1;
        }
        
        else if(s[left] != s[right]){
            if(s[left] == s[right-1] && s[left+1] == s[right-2]){
                return right;
            }
            else if(s[right] == s[left+1] && s[right-1] == s[left+2]){
                return left;
            }
        }
        
        left++;
        right--;
    }
    

    return -1;
}

